import React from 'react';
import { useParams } from 'react-router-dom';

const MenuPage = () => {
    const { menuName } = useParams();

    return (
        <div>
            <h1>{menuName}</h1>
            <p>This is a placeholder page for the {menuName} menu item.</p>
        </div>
    );
};

export default MenuPage;
